import React, { Component } from 'react'
import {Icon} from 'semantic-ui-react'

export default class Footer extends Component {

    render(){
        return(
            <div className='footer'>
            <h3 >Questions? Concerns? Ideas?  Contact our email: <a rel="noopener noreferrer" href="mailto:{esgduke@gmail.com}" target="_blank"><Icon name='mail outline'/></a></h3>
            </div>
        )
    }
}
